description: >-
  Chtěli bychom vás všechny srdečně pozvat na naši rozlučkovou akci. Bude to
  poslední party pořádaná značkou Salsa Liberec. Pojďme si spolu zatančit a
  oslavit všechny ty krásné okamžiky, které jsme spolu zažili.


  Tato akce bude nejen naší rozlučkou, ale také oslavou naší společné vášně pro tanec a vzájemného přátelství. Přijďte si užít poslední taneční večer s námi, vzpomenout si na všechny dobré časy a rozloučit se ve velkém stylu.


  S láskou,

  Lucie a Lukáš 

  a celý tým Salsa Liberec 
